import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
export default function House(props) {
  return (
      <div className=" p-3 rounded-lg flex flex-row   border hover:shadow-lg ease-linear transition-all duration-150">
        <div className="flex flex-col w-full sm:w-fit text-center sm:text-start mt-2 sm:mt-0 sm:ml-4 md:mx-6 sm:py-2">
          <div>
            <picture className="max-w-[300px] aspect-square m-2">
              <img
                src={`${props.url}`}
                loading="lazy"
                className="w-full h-full rounded-full shadow-lg object-cover"
              />
            </picture>
          </div>
        </div>
        <div className>
          <Card sx={{ maxWidth: 500 }}>
          <CardContent>
            <Typography gutterBottom variant="h5" component="div">
            {props.name}
            </Typography>
            <Typography variant="body2" color="text.secondary">
            {props.intro}
            </Typography>
          </CardContent>
          <CardActions>
            <Button size="small">評分:{props.score.toFixed(1)}</Button>
            <Button size="small">價格:{props.price}</Button>
            <Button size="small">地點:台北市</Button>
          </CardActions>
          </Card>
        </div>
      </div>
  );
}
